import { useGetTextsQuery } from "../../app/API/textsAPI"
import { Text } from "../../app/types/types"

export default function Texts(){
    const { data: texts, isSuccess } = useGetTextsQuery()
    return (
        <div className='grid grid-cols-1 gap-4 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 2xl:grid-cols-5'>
            {isSuccess && texts.map((el: Text, i: number) => {
                return <div key={i}>{el.title}</div>
            })}
        </div>
    )
}
